import React, {useState, useEffect} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import axios from 'axios';
import {Modal, ModalBody, ModalHeader, ModalFooter } from 'reactstrap';


function App() {

  const baseUrl="https://localhost:44370/api/usuarios";
  const [data, setData] = useState([]);
  const [modalEditar, setModalEditar] = useState(false)
  const [modalInsertar, setmodalInsertar] = useState(false);
  const [usuarioSeleccionado, setUsuarioSeleccionado] = useState({
    idUsuario: '',
    nombre: '',
    apellidos: '',
    direccion: '',
    telefono: '',
    email: '',
    edad: '',
    rol: '',
    permiso: '',
    nombreUsuario: '',
    clave: ''
  });

  const handleChange =(e)=>{
    e.preventDefault(); 
    const {name, value}=e.target;
    setUsuarioSeleccionado({
      ...usuarioSeleccionado,
      [name]:value
  },);

    console.log(usuarioSeleccionado);
  }
  const openCloseModal=()=>{
    setmodalInsertar(!modalInsertar);
  }
  const openCloseModalEditar=()=>{
    setModalEditar(!modalEditar);
  }

  const peticionGet=async()=>{
    await axios.get(baseUrl)
    .then(response=>{
      setData(response.data.usuario);
      console.log(response.data.usuario);
    }).catch(error=>{
      console.log(error);
    });
  }

  const peticionPost=async()=>{
    delete usuarioSeleccionado.idUsuario;
    await axios.post(baseUrl, usuarioSeleccionado)
    .then(response=>{
      setData(data.concat(response.data.usuario));
      console.log(response.data.usuario);
      openCloseModal();
    }).catch(error=>{
      console.log(error);
    });
  }

  useEffect(() => {
    peticionGet();
  }, [])

  return (
    <div className="App">
      <button onClick={()=>openCloseModal()} className='btn btn-success'>Insertar Nuevo</button>
    <table className='table table-bordered'>
      <thead>
        <tr>
          <th>Id</th>
          <th>Nombres</th>
          <th>direccion</th>
          <th>Telefono</th>
          <th>Email</th>
          <th>Edad</th>
          <th>Rol</th>
          <th>Permiso</th>
          <th></th>
        </tr>
      </thead>
      <tbody>
          {data.map(usuario=>(
          <tr key={usuario.idUsuario}>
            <td>{usuario.idUsuario}</td>
             <td>{usuario.nombre} {usuario.apellidos} </td>
             <td>{usuario.direccion}</td>
            <td>{usuario.telefono}</td>
            <td>{usuario.email}</td>
            <td>{usuario.edad}</td>
            <td>{usuario.rol}</td>
            <td>{usuario.permiso}</td>  
            <td>
              <button className='btn btn-primary'>Editar</button> {""}
              <button className='btn btn-danger'>Eliminar</button>
            </td>
          </tr>
        )) }  
      </tbody>
